import React from "react";
import { Text, View } from "react-native";
import { Card, ThemeProvider } from "react-native-elements";
import { BarChart, PieChart } from "react-native-chart-kit";
import RNPickerSelect from 'react-native-picker-select';

const Activities = () => {
    return (
        < ThemeProvider >
            <View>
                <RNPickerSelect
                    onValueChange={(value) => console.log(value)}
                    items={[
                        { label: 'Football', value: 'football' },
                        { label: 'Baseball', value: 'baseball' },
                        { label: 'Hockey', value: 'hockey' },
                    ]}
                />
                <Card style={{ width: 2000 }}>

                    <script
                        type="text/javascript"
                        async
                        id="calories-burned-calculator"
                        data-type="verywell-tool"
                        data-vertical="verywellfit"
                        src="https://www.verywellfit.com/static/4.143.0/components/tools/calculators/iframe-embed/embed.min.js?id=calories-burned-calculator"
                    ></script>


                </Card>
            </View>
        </ThemeProvider >
    );
};
export default Activities;
